import React from 'react'


const Nav = () => {
  const categories = [
    "Dogs",
    "Cats",
    "Jokes",
    "Inspiration"
  ]
  return (
    <nav className='w-auto'>
      <ul className='flex m-auto justify-center'>
        {
          categories.forEach((category) => {
            <li className='text-lg'>
              {category}
            </li>
          }) 
        }
      </ul>
    </nav>
  )
}

export default Nav
